
import unittest


class Solution:
    def find(self, now, tasks, ends):
        result = list(filter(lambda x: ends.get(x[0]) < now, tasks))
        # print(tasks)
        # print(result)
        maxCount = 0
        minEnd = None
        maxRes = None
        for task in result:
            [tid, count] = task
            if maxCount < count:
                maxCount = count
                minEnd = ends.get(tid)
                maxRes = task
            elif maxCount == count:
                if minEnd > ends.get(tid):
                    minEnd = ends.get(tid)
                    maxRes = task

        # print(maxRes)
        return maxRes

    def leastInterval(self, tasks, n):
        """
        :type tasks: List[str]
        :type n: int
        :rtype: int
        """
        tasks2 = {}
        starts = {}
        ends = {}
        for t in tasks:
            tasks2[t] = tasks2.get(t, 0) + 1
            ends[t] = -1

        tasks3 = []
        for (k, v) in tasks2.items():
            tasks3.append([k, v])

        now = 0
        lastTask = None
        result = []
        while len(tasks3) > 0:
            task = self.find(now, tasks3, ends)
            # print("now task", task)
            if task:
                lastTask = task
                task[1] -= 1
                if task[1] == 0:
                    tasks3.remove(task)
                starts[task[0]] = now
                ends[task[0]] = now + n
                result.append(task[0])
            else:
                result.append(None)
            # now = max(now, min(ends.values())) + 1
            now += 1

        # print(result)

        return starts.get(lastTask[0]) + 1


